import {Modal, ModalOverlay, Button, useDisclosure, ModalContent, ModalHeader, ModalFooter, ModalBody, ModalCloseButton} from "@chakra-ui/react";


export default function AuhtModal() {

  const { isOpen, onOpen, onClose } = useDisclosure()
  return (
    <>
       <Button 
            bg={'blue.200'}
            fontWeight={'400'}
            _hover={{ bg: 'blue.100' }}
            width={'100px'}
            onClick={() => {
                onOpen()
            }}

            >Log in</Button>

      <Modal isOpen={isOpen} onClose={onClose}>
        <ModalOverlay />
        <ModalContent>
          <ModalHeader>Modal Title</ModalHeader>
          <ModalCloseButton />
          <ModalBody>
            Modal 
          </ModalBody>

          <ModalFooter>
            <Button colorScheme='blue' mr={3} onClick={onClose}>
              Close
            </Button>
            <Button variant='ghost'>Secondary Action</Button>
          </ModalFooter>
        </ModalContent>
      </Modal>
    </>
  )
}
